import React, { useContext } from 'react';
import Card from './Card';


const MapCard = (value) => {
     MapCard = useContext();
   return( <Card 
        imgsrc={value.imgsrc}
        key={value.Id}
        brand = {value.brand} 
        detail = {value.detail}
        price={value.price}
    /> );


};

export default MapCard;
